	public static String get_access_token(String jsonConfig) throws IOException {
		String response = "";
		HttpURLConnection conn = null;
		try {
			SignatureConfig signatureConfig = new SignatureConfig();
			if (jsonConfig != null && !"".equals(jsonConfig)) {
				Gson gson = new Gson();
				signatureConfig = gson.fromJson(jsonConfig, SignatureConfig.class);

				String urlParameters = "grant_type=" + signatureConfig.getGrant_type() + "&client_id="
						+ signatureConfig.getClient_id() + "&client_secret=" + signatureConfig.getClient_secret()
						+ "&username=" + signatureConfig.getUsername() + "&password=" + signatureConfig.getPassword();
				byte[] postData = urlParameters.getBytes(StandardCharsets.UTF_8);
				String request = signatureConfig.getEndpoint();
				URL url = new URL(request);
				conn = (HttpURLConnection) url.openConnection();
				conn.setDoOutput(true);
				conn.setInstanceFollowRedirects(false);
				conn.setRequestMethod("POST");
				conn.setRequestProperty("Content-Type", "application/x-www-form-urlencoded");
				conn.setRequestProperty("requestID", signatureConfig.getRequestID());
				conn.setRequestProperty("appToken", signatureConfig.getAppToken());
				conn.setUseCaches(false);
				DataOutputStream out = new DataOutputStream(conn.getOutputStream());
				out.write(postData);
				out.close();
				int status = conn.getResponseCode();
				BufferedReader in = new BufferedReader(new InputStreamReader(conn.getInputStream()));
				StringBuffer content = new StringBuffer();
				String inputLine;
				while ((inputLine = in.readLine()) != null) {
					content.append(inputLine);
				}
				in.close();
				response = content.toString();
				System.out.println(content);
			} else return null;
		} catch (Exception e) {
			e.printStackTrace();
			response = e.getMessage();
		}finally {
			if(conn != null) {
				conn.disconnect();
			}
		}
		return response;
	}

	public static String hashFile(String fileBase64, String certBase64) throws HashSignerException, IOException {
		String hashValue = "";
		try {
			certBase64 = certBase64.replace("-----BEGIN CERTIFICATE-----", "").replace("\\r\\n", "")
					.replace("-----END CERTIFICATE-----", "");
			byte[] fileContent = Base64.getDecoder().decode(fileBase64);
			SignatureParameter param = new SignatureParameter(fileContent, certBase64);
			IHashSginer signer = null;
			signer = HashSignerFactory.genenrateSigner(DocumentType.PDF, param);
			PdfHashSigner pdfSigner = (PdfHashSigner) signer;
			// Set Hash
			pdfSigner.setHashAlgorithm(MessageDigestAlgorithm.SHA256);
			// [REQUIRED] Vi tri dat chu ky
			pdfSigner.addSignatureViews(new PdfSignatureView(Integer.parseInt("1"), "0,581,200,657"));
			// [OPTIONAL] Màu chữ (default=000000)
			pdfSigner.setFontColor("FF0000");
			// [OPTIONAL] Font chữ (default=Times_New_Roman)
			pdfSigner.setFontName(FontName.Times_New_Roman);
			// [OPTIONAL] Cỡ chữ (default=13)
			pdfSigner.setFontSize(Integer.parseInt("12"));
			// [OPTIONAL] Kiển chữ (default=Normal)
			pdfSigner.setFontStyle(FontStyle.Normal);
			pdfSigner.useCertChain();
			hashValue = signer.getSecondHashAsBase64();
			System.out.println("hashValue: " + hashValue);
		} catch (Exception e) {
			e.printStackTrace();
		}
		return hashValue;
	}
	
	public static String getContentFileSigned(String dataSigned, String certBase64, String fileBase64) {
		String fileResp = "";
		try {
			String hashValue = "";
			certBase64 = certBase64.replace("-----BEGIN CERTIFICATE-----", "").replace("\\r\\n", "")
					.replace("-----END CERTIFICATE-----", "");
			byte[] fileContent = Base64.getDecoder().decode(fileBase64);
			SignatureParameter param = new SignatureParameter(fileContent, certBase64);
			IHashSginer signer = null;
			signer = HashSignerFactory.genenrateSigner(DocumentType.PDF, param);
			PdfHashSigner pdfSigner = (PdfHashSigner) signer;
			ByteArrayInputStream inStream = new ByteArrayInputStream(fileContent);
	        PdfReader reader = new PdfReader(inStream);
	        int pageNumber = reader.getNumberOfPages() - 1;
			// Set Hash
			pdfSigner.setHashAlgorithm(MessageDigestAlgorithm.SHA256);
			// [REQUIRED] Vi tri dat chu ky
			pdfSigner.addSignatureViews(new PdfSignatureView(pageNumber, "0,101,200,-50"));
			// [OPTIONAL] Màu chữ (default=000000)
			pdfSigner.setFontColor("FF0000");
			// [OPTIONAL] Font chữ (default=Times_New_Roman)
			pdfSigner.setFontName(FontName.Times_New_Roman);
			// [OPTIONAL] Cỡ chữ (default=13)
			pdfSigner.setFontSize(Integer.parseInt("12"));
			// [OPTIONAL] Kiển chữ (default=Normal)
			pdfSigner.setFontStyle(FontStyle.Normal);
			pdfSigner.useCertChain();  
			hashValue = signer.getSecondHashAsBase64();
			byte[] signedData = signer.sign(dataSigned);
			fileResp = Base64.getEncoder().encodeToString(signedData);
			System.out.println("hashValue: " + hashValue);
		} catch (Exception e) {
			e.printStackTrace();
		}
		return fileResp;
	}
	
